import React from 'react';

export default function Card({features})
{
    return(
        <div className="card">
            <div className="card-container">
            <h3>{features.name}</h3>
            <h4 class>{features.country}</h4>
            <h4>Wind Probability</h4>
            <h4>{features.probability}</h4>
            <h4>Latitude</h4>
            <h4>{features.lat}* N</h4>
            <h4>Longitude</h4>
            <h4>{features.long}* W</h4>
            <h4>When to go</h4>
            <h4>{features.month}</h4>
            </div>
        </div>
    )
}
